import React from 'react'
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import "./style/App_fournisseur.css";


import Register_fournisseur from './Register_fournisseur';
import Login_fournisseur from './Login_fournisseur';
import useToken from './Deconnexion_fournisseur';
import Deconnexion_fournisseur from './Deconnexion_fournisseur';
import Offre from './Offre';

//npm start to start a webpage



function App() {
    const { token, removeToken, setToken } = useToken();


	return (
    <BrowserRouter>
        <h1>Application Fournisseur</h1>
        <Link to="/Register_fournisseur"> S'inscrire</Link>
        <Link to="/Login_fournisseur"> Se connecter</Link>
        <Deconnexion token={removeToken}/>
    <Routes>
    <>
    <Route path="/Register_fournisseur" element ={<Register_fournisseur/>}/>
    <Route path="/Login_fournisseur" element ={<Login_fournisseur/>}/>
    </>
    </Routes>
    </BrowserRouter>
	)

}

export default App
